import { Link } from "react-router-dom";

export default function ProductsPage() {
  return (
    <>
      <h1>Componente ProductsPage</h1>
      <ul>
        <li><Link to=''>Producto 1</Link></li>
        <li>Producto 2</li>
        <li>Producto 3</li>
      </ul>
    </>
  );
}
